import React from 'react';
import styled from 'styled-components';
import {setFlex} from '../../utilities';

const SlideFour = ({className}) => {
  return (
    <div className={className}>
      <h3>SLIDE FOUR</h3>
    </div>
  );
}

const SFour = styled(SlideFour)`
  ${setFlex()};
  color: white;
  width: 100%;
  height: 70vh;
`;

export default SFour;
